import React from "react";
import DeleteIcon from '@material-ui/icons/Delete';
import Button from '@material-ui/core/Button';

const List = (prop) => {
    return (
        <div className="todo_style">
            <li>{prop.text}</li>
            <Button className="deleteIcon">
                <DeleteIcon/>
            </Button>
        </div>
    )
}

export default List;
